import React from 'react'
import './App.css'
import Mapper from './mapper.js'
import {data} from './folder-structure'

function App() {

  return (
    <>
        {data.map((item,index)=>{
            return <Mapper key={index} arrItem = {item}/>
        })}
    </>
  );
}

export default App;
